import React, { Component } from 'react'
import { MDBCol, MDBRow, MDBCard, MDBCardUp, MDBCardBody, MDBRotatingCard, MDBIcon,MDBCardImage,MDBCardTitle,MDBCardText,MDBBtn } from "mdbreact";


export default class Cards extends Component {
    render() {

        const products = this.props.data.map((item)=> 
        <Card style={{ width: "20rem" }}>
       <a href = {`/proudectdetails/${item.id}`} ><Card.Img variant="top" src= {item.image} /></a>
       <Card.Body>
       <Card.Title>{item.name}</Card.Title>
         <Card.Text>
         {item.desc}
         </Card.Text>
         <Card.Title>{item.price}</Card.Title>
         <a href = {`/proudectdetails/${item.id}`} > <Button variant="secondary"  >Buy Now </Button></a>
       </Card.Body>
     </Card>
     )
     const product = this.props.data.map((item)=> 

        <MDBCol>
          <MDBCard style={{ width: "22rem" }}>
            <MDBCardImage className="img-fluid" src={item.image} waves />
            <MDBCardBody>
              <MDBCardTitle>{item.name}</MDBCardTitle>
              <MDBCardText>
              {item.desc}
              </MDBCardText>
              <MDBBtn href={`/proudectdetails/${item.id}`}>Buy Now</MDBBtn>
            </MDBCardBody>
          </MDBCard>
        </MDBCol>
     )





        return (
            <div>
                                {product}

                {product}
            </div>
        )
    }
}
